@route('/')
def index():
    # print(path)
    return template(path + "/index.html")


@route('/css/<css_file>')
def css(css_file):
    return static_file(css_file, root='css')


@route('/js/<js_file>')
def js(js_file):
    return static_file(js_file, root='js')

@route("/images/<filepath:re:.*\.(jpg|png|gif|ico|svg)>")
def img(filepath):
    return static_file(filepath, root="images")

@post('/save')
def receive_board():
    board = request.json['board']
    for square in board:
        square = int(square)
        saved_board[square] = board[str(square)]
    print(saved_board)



@get('/getopening')
def send_opening():
    return json.dumps(match_check())


